import '../styles.css';

const Home = () => {
  return (
    <>
      <div className="home-container">
        <main className="home-main">
          <div className="content-wrapper">
            <h1 className='home-text-title'>tammyTran = ['developer', 'designer'],</h1>
            <h3>// full-stack developer who loves to learn and make cool things! Add more later :)</h3>
          </div>
        </main>
      </div>
    </>
  );
};

export default Home;
